const content = $json.choices[0].message.content;

// Split into sections using regex or simple splitting
const summaryMatch = content.match(/\*\*1\. Summary.*?\*\*(.*?)\*\*2\./s);
const skillsMatch = content.match(/\*\*2\. Key Required Skills.*?\*\*(.*?)\*\*3\./s);
const coverLetterMatch = content.match(/\*\*3\. Tailored Cover Letter.*?\*\*\s+```txt([\s\S]*?)```/);

return [
  {
    json: {
      summary: summaryMatch ? summaryMatch[1].trim() : "",
      skills: skillsMatch ? skillsMatch[1].trim() : "",
      coverLetter: coverLetterMatch ? coverLetterMatch[1].trim() : ""
    }
  }
];
